    'about.CompletelyFree': 'OLX es completamente gratis, tanto para el vendedor como para el comprador.',
    'about.ControlSteps': 'Con OLX puedes controlar todos los pasos del proceso de compra y venta.',
    'about.Countries': 'Pa\xEDses',
    'about.CuttingEdgeApps': 'OLX tiene aplicaciones de \xFAltima generaci\xF3n para todos los dispositivos, lo que te permite comprar y vender en todo momento y en todo lugar.',
    'about.Download_Mob': 'Descargar',
    'about.EcoFriendly': 'Se ecol\xF3gico',
    'about.EcoFriendlyText': 'Los productos usados son extremadamente ecol\xF3gicos. Ya que no generan emisiones de carbono ni ni utilizan recursos naturales. Es aun mejor que el reciclar.',
