    'featured_listings.AdditionalTermsForFeaturedAds': 'T\xE9rminos Adicionales para Avisos Destacados',
    'featured_listings.AdditionalTermsForFeaturedAds_content': '\xC9stos t\xE9rminos adicionales, en conjunto con las <<LINK_TERMS_USE>>Condiciones de Uso<</LINK_TERMS_USE>> del Sitio, rigen el uso de Avisos Destacados:<br /><ul><li>Como prueba de pago de un Aviso Destacado, OLX s\xF3lo emitir\xE1 una \u201COrden de Confirmaci\xF3n\u201D que ver\xE1s al final del proceso de pago y una confirmaci\xF3n por email.</li><li>Si por alguna raz\xF3n, ya sea t\xE9cnica o de cualquier otra naturaleza, tu aviso no se muestra en la zona de \u201CAvisos Destacados\u201D, la \xFAnica obligaci\xF3n de OLX es agregar tu aviso en la zona de "Avisos Destacados" tan pronto como sea posible.</li><li>Un tercero provee los servicios de facturaci\xF3n.</li><li>Seg\xFAn el criterio discrecional de OLX, los avisos que sean ofensivos, pornogr\xE1ficos, spam (inclu\xEDda la duplicaci\xF3n de avisos), posibles estafas o que puedan infringir los derechos de autor, no ser\xE1n destacados y el pago no ser\xE1 reembolsado.</li><li>ESTE SERVICIO DE AVISOS DESTACADOS SE PROVEE EN BASE A "SU CONDICI\xD3N ACTUAL" O "SU DISPONIBILIDAD ", SIN NING\xDAN TIPO DE  GARANT\xCDAS Y EN LA M\xC1XIMA EXTENSI\xD3N DE LO QUE PERMITE LA LEY.  OLX NO GARANTIZA NI REPRESENTA NI ASUME OBLIGACI\xD3N LEGAL NI RESPONSABILIDAD ALGUNA POR LA INTEGRIDAD, COMPLETITUD O EXACTITUD DEL CONTENIDO LISTADO EN EL SERVICIO DE AVISOS DESTACADOS.</li></ul>',
    'featured_listings.Benefits': 'Beneficios',
    'featured_listings.Benefits_content': 'Tu aviso obtiene una mejor posici\xF3n al aparecer en las secciones de Avisos Destacados que se describen a continuaci\xF3n. Las im\xE1genes siguientes muestran los dos tipos de Avisos Destacados disponibles.',
    'featured_listings.Feature': 'Destacar',
    'featured_listings.FeaturedListings_Content': 'El servicio de Avisos Destacados permite que tu aviso aparezca en las zonas de Avisos Destacados proporcion\xE1ndole hasta 20 veces m\xE1s visibilidad respecto de un aviso normal o no destacado!*',
    'featured_listings.FeatureMyListing': 'Destacar mi Aviso',
    'featured_listings.FeatureYourListingForUp20TimesVisibility': '<<LINK_FEATURED_LISTINGS>>Destaca tu aviso<</LINK_FEATURED_LISTINGS>> \xA1hasta 20 veces m\xE1s visibilidad!',
    'featured_listings.HowDoesItWork': '\xBFC\xF3mo funciona?',
    'featured_listings.HowDoesItWork_New': 'Los avisos destacados en la parte superior del listado de avisos y en los resultados de b\xFAsqueda se muestran en la subcategor\xEDa correspondiente y se turnan aleatoriamente con todos los los avisos de la misma subcategor\xEDa y localizaci\xF3n. La selecci\xF3n del aviso destacado se realiza siempre aleatoriamente para permitir que todos los compradores de avisos destacados tengan las mismas oportunidades de aparecer en el sitio web. Por este motivo es posible que tu aviso no aparezca siempre en la secci\xF3n correspondiente de avisos destacados.',
    'featured_listings.HowDoIBuyAFeaturedListing': '\xBFC\xF3mo puedo adquirir un Aviso Destacado?',
    'featured_listings.HowDoIBuyAFeaturedListing_New': 'Puedes comprar los avisos destacados en el \xFAltimo paso del proceso de publicaci\xF3n que confirma la publicaci\xF3n del aviso desde Mi OLX. El proceso es muy sencillo, puedes seleccionar durante cu\xE1ntas semanas quieres destacar el aviso. Luego se te dirigir\xE1 a la p\xE1gina de pago, dispone de varios m\xE9todos de pago. Despu\xE9s de realizar el pago recibir\xE1s una confirmaci\xF3n de que tu aviso estar\xE1 disponible durante el periodo de tiempo seleccionado. Si tu aviso cumple con los t\xE9rminos de uso de OLX, recibir\xE1s una confirmaci\xF3n por email. Ten en cuenta que no se realizar\xE1 en ning\xFAn caso la devoluci\xF3n del dinero una vez comprado el aviso destacado. Todas las compras de avisos destacados son definitivas.',
    'featured_listings.HowDoIFeatureMyAd': '\xBFC\xF3mo destaco mi aviso?',
    'featured_listings.HowLongWillMyListingAppearInFeaturedListings': '\xBFDurante c\xFAanto tiempo aparecer\xE1 mi aviso en la secci\xF3n de Avisos Destacados?',
    'featured_listings.HowLongWillMyListingAppearInFeaturedListings_content': 'Los Avisos Destacados se venden por semanas (7 d\xEDas). Puedes destacar tu aviso por hasta 4 semanas.',
    'featured_listings.HowMuchDoesItCost': '\xBFCu\xE1nto cuesta?',
    'featured_listings.HowMuchDoesItCost_New': 'Los avisos en la parte superior del listado de avisos y en los resultados de b\xFAsqueda cuestan <<LISTING_OTHER_CATS_FEATURED_PRICE>> por semana.Puedes seleccionar el periodo de tiempo en el que quieres destacar el aviso en la parte superior del listado de avisos y en los resultados de b\xFAsqueda hasta un m\xE1ximo de 4 semanas.',
    'featured_listings.HowMuchVisitsWillIncrease': '\xBFCu\xE1nto aumentar\xE1n las visitas a mi aviso?',
    'featured_listings.HowMuchVisitsWillIncrease_content': 'El objetivo de Avisos Destacados es mejorar la visibilidad de tu aviso.<br />En promedio 8 veces m\xE1s usuarios ven tu aviso en comparaci\xF3n a los avisos normales.*  En las categor\xEDas con m\xE1s avisos puedes aumentar la visibilidad hasta 20 veces.',
    'featured_listings.IDontSeeMyListingInFeaturedListings': 'No encuentro mi aviso en la secci\xF3n de Avisos Destacados',
    'featured_listings.IDontSeeMyListingInFeaturedListings_content': 'Si has comprado un Aviso Destacado y no lo puedes ver en el \xE1rea designada, por favor: <br /><ul><li>Comprueba que has recibido un email confirmando que tu Aviso Destacado ha sido publicado. Un aviso destacado puede tardar hasta 24 horas en ser comprobado.</li><li>Verifica la fecha de inicio y final del Aviso Destacado en el email de confirmaci\xF3n.</li><li>Recuerda que los avisos est\xE1n en \u201Crotaci\xF3n\u201D con otros de la misma categor\xEDa y lugar, por lo que no siempre se muestra. Por regla general, suele haber un m\xE1ximo de 18 avisos "rotando" en cada categor\xEDa por lo que tu aviso aparecer\xE1 aproximadamente una de cada tres veces que se cargue la p\xE1gina de Avisos Destacados en la parte superior del Listado de Avisos y Resultados de B\xFAsqueda.*</li><li>Si todav\xEDa encuentras alg\xFAn error, <<CONTACTLINK>>contacta a nuestro Equipo de Atenci\xF3n al Cliente<</CONTACTLINK>>.</li></ul>',
